description:
Stay Strong VN is a collection of twenty 1/1 licensed copies of photographs taken around Vietnam by Christopher Otis, a teacher and photographer who has lived in Vietnam since 2017. The photographs chosen for the Stay Strong VN collection were carefully selected to represent different sides of Vietnam's beauty and resilient spirit.

Currently, Vietnam is in the midst of battling its worst outbreak of the COVID-19 pandemic, with Ho Chi Minh City as the epicenter of the crisis. Overwhelmed healthcare systems have necessitated strict social distancing measures that have deeply affected the nation's most vulnerable citizens.

60% of the initial sales of each set - $3200 total - was donated directly to charity to help the country's most vulnerable get through the COVID-19 crisis.

Set 1 - saigonchildren;
Set 2 - saigonchildren;
Set 3 - Blue Dragon;
Set 4 - Blue Dragon

